/*
-- Struttura della tabella `INCONTRO`
*/ 

CREATE TABLE INCONTRO(
  id_incontro INT(11) NOT NULL AUTO_INCREMENT,
  numero_giornata INT(2) DEFAULT NULL,
  data_incontro DATE NOT NULL, /*AAAA-MM-GG*/
  ora_incontro TIME DEFAULT NULL, /*HH:MM:SS*/
  cod_edizione_incontro INT(11) NOT NULL,
  squadra_casa INT(11) NOT NULL,
  squadra_trasferta INT(11) NOT NULL,
  goal_casa TINYINT(4) NOT NULL,
  goal_trasferta TINYINT(4) NOT NULL,
  /*luogo VARCHAR(50) NOT NULL,*/

  PRIMARY KEY (id_incontro),
  FOREIGN KEY (cod_edizione_incontro, squadra_casa) REFERENCES PARTECIPAZIONE (cod_edizione, cod_squadra),
  FOREIGN KEY (cod_edizione_incontro, squadra_trasferta) REFERENCES PARTECIPAZIONE (cod_edizione, cod_squadra)
);



